import React, { Fragment } from "react";
import { Container, Row, Col, Card, CardHeader, Button, CardBody } from 'reactstrap';
import "./styles.css";

const CreateNewHackerProfileContentPostHelper = ({  }) => {
    return (
        <Fragment>
            <Container fluid={true}>
                <Row>
                    <Col sm="12" md="12" lg="12" xl="12">
                        <Card>
                            <CardHeader className="b-l-primary border-3">
                                <h6 className={"text-center custom-card-header-create-post"}>You're currently on the 'create a new post' page which will create new data to post on your primary profile content section/sector...</h6>
                            </CardHeader>
                            <CardBody>
                                <h1> ~ CreateNewHackerProfileContentPostHelper helper... ~ </h1>
                                <hr />
                                <Button type={"submit"} style={{ marginTop: "7.5px" }} color={"success-2x"} outline className="btn-square-success text-center"><i className="fa fa-plus m-r-5"></i>Submit & Post New Data!</Button>
                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
}
export default CreateNewHackerProfileContentPostHelper;
